import React from 'react'
import Navbar from "../Components/NavBar";
import NavCardMenu from "../Components/NavCardMenu";
import styled from 'styled-components';
import Footer from '../Components/Footer';
import HomeCardList from '../Components/HomeCardList';


const Container = styled.div`
    height: 100vh;


`;

const Title = styled.h1`
    margin: 20px;
`;

const FilterContainer = styled.div`
    display: flex;
    height: 50px;
    justify-content: space-between;
`;

const Filter = styled.div`
    margin: 20px;

`;

const FilterText = styled.span`
    font-size: 20px;
    font-weight: 600;
`;

const Select = styled.select`

`;

const Option = styled.option`

`;

const ProductList = () => {
    return (
        <Container>
            <Navbar />
            <NavCardMenu />
            <Title>Pokemon</Title>
            <FilterContainer>
                <Filter><FilterText>Filter Cards: </FilterText></Filter>
                <Select>
                    <Option disabled selected>Card Set</Option>
                    <Option>Base Set</Option>
                    <Option>Sword and Shield</Option>
                    <Option>Jungle</Option>
                    <Option>Fossil</Option>



                </Select>
                <Filter><FilterText>Sort Cards: </FilterText></Filter>
            </FilterContainer>
            <HomeCardList />
            <Footer />
        </Container>
    );
}

export default ProductList
